toremove = [] # list of mailNos of duplicates
count = 0
names = {}

for mail in mails:
    l = []
    if mail["from"] != None and mail["to"] != None:
        fr = mail["from"].replace('@',' ').replace('.',' ').replace(',',' ').lower().split(" ")
        to = mail["to"].replace('@',' ').replace('.',' ').replace(',',' ').lower().split(" ")
        l = fr + to
        if mail["cc"] != None:
            cc = mail["cc"].replace('@',' ').replace('.',' ').replace(',',' ').lower().split(" ")
            l = fr + to + cc
        for name in l:
            if name not in names.keys() and name.isalnum() and len(name)>2:
                names[name] = 1
            elif name in names.keys():
                names[name] += 1


print(names)
print(len(names))

